    "summary": "Herb and Cheddar Cordon Bleu might be just the main course you are searching for. This recipe makes 2 servings with <b>576 calories</b>, <b>47g of protein</b>, and <b>21g of fat</b> each. For <b>$2.83 per serving</b>, this recipe <b>covers 33%</b> of your daily requirements of vitamins and minerals. If you have breadcrumbs, flour, chicken breasts, and a few other ingredients on hand, you can make it. To use up the flour you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-tart-with-caramel-sauce-47961\">Apple Tart with Caramel Sauce</a> as a dessert. From preparation to the plate, this recipe takes approximately <b>1 hour</b>. Try <a href=\"https://spoonacular.com/recipes/chicken-cordon-bleu-74163\">Chicken Cordon Bleu</a>, <a href=\"https://spoonacular.com/recipes/chicken-cordon-bleu-266803\">Chicken Cordon Bleu</a>, and <a href=\"https://spoonacular.com/recipes/cordon-bleu-casserole-110208\">Cordon Bleu Casserole</a> for similar recipes.",
