    "instructions": "<ol><li>Pre-heat the oven to 350 degrees F (about 176 degrees C).</li><li>Put the chicken breasts between two slices of wax paper and flatten with a rolling pin or meat mallet until they are about a quarter of an inch thick. </li><li>Place a slice of ham and a slice of cheddar on each chicken breast.</li><li>Roll the chicken breast as tightly as possible. If necessary, secure the rolls with toothpicks or small skewers.</li><li>Beat an egg in a shallow baking dish. </li><li>Arrange two other \"stations\" using foil or other dishes, one for the flour and another for the dried herbs and breadcrumbs. </li><li>Cover the rolled chicken breasts in flour, then dip them into the egg mixture. </li><li>Finally, press them into the mixture of dried herbs and breadcrumbs until they are covered on all sides.</li><li>Place the chicken in an oiled (or buttered) baking dish and bake for about 30 minutes.</li></ol>",
