    "summary": "The recipe Fudgy chocolate cream cheese brownies with Baileys could satisfy your American craving in roughly <b>45 minutes</b>. This recipe makes 8 servings with <b>581 calories</b>, <b>7g of protein</b>, and <b>34g of fat</b> each. For <b>$1.35 per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. If you have flour, bittersweet chocolate, sugar, and a few other ingredients on hand, you can make it. This recipe from Foodista has 143 fans. All things considered, we decided this recipe <b>deserves a spoonacular score of 34%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/fudgy-cream-cheese-brownies-221991\">Fudgy Cream Cheese Brownies</a>, <a href=\"https://spoonacular.com/recipes/ultimate-fudgy-cappuccino-cream-cheese-brownies-55124\">Ultimate Fudgy Cappuccino Cream Cheese Brownies</a>, and <a href=\"https://spoonacular.com/recipes/chocolate-stout-cake-with-baileys-irish-cream-cheese-frosting-507379\">Chocolate Stout Cake with Baileys Irish Cream Cheese Frosting</a> for similar recipes.",
