    "summary": "If you want to add more <b>gluten free and dairy free</b> recipes to your recipe box, Classic Pot Roast might be a recipe you should try. This main course has <b>340 calories</b>, <b>30g of protein</b>, and <b>22g of fat</b> per serving. This recipe serves 6. For <b>$1.87 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. 9 people have made this recipe and would make it again. It is brought to you by Foodista. A mixture of baby carrots, beer, celery stalks, and a handful of other ingredients are all it takes to make this recipe so delicious. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 56%</b>, which is solid. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/classic-pot-roast-484451\">Classic Pot Roast</a>, <a href=\"https://spoonacular.com/recipes/classic-pot-roast-293385\">Classic Pot Roast</a>, and <a href=\"https://spoonacular.com/recipes/classic-pot-roast-534670\">Classic Pot Roast</a>.",
