    "summary": "Whole Grain Pumpkin Bread is a <b>dairy free and vegetarian</b> morn meal. One serving contains <b>182 calories</b>, <b>5g of protein</b>, and <b>3g of fat</b>. This recipe serves 24 and costs 42 cents per serving. A couple people made this recipe, and 13 would say it hit the spot. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. A mixture of eggs, salt, ground cloves, and a handful of other ingredients are all it takes to make this recipe so scrumptious. All things considered, we decided this recipe <b>deserves a spoonacular score of 68%</b>. This score is pretty good. Similar recipes include <a href=\"https://spoonacular.com/recipes/multi-grain-pumpkin-cranberry-bread-66662\">Multi-Grain Pumpkin Cranberry Bread</a>, <a href=\"https://spoonacular.com/recipes/grain-free-pumpkin-pie-496345\">Grain Free Pumpkin Pie</a>, and <a href=\"https://spoonacular.com/recipes/whole-grain-pumpkin-scones-311551\">Whole-Grain Pumpkin Scones</a>.",
