    "instructions": "<ol><li>Preheat oven at 175C, Grease a 9\" bundt pan, and dust flour or spray non-stick spray in pan.</li><li>Beat butter for a while and add in sugar, continue to beat butter until creamy.</li><li>Add eggs one at a time and mix well. Add orange rind, orange juice and vanilla extract, beat at low speed till well combined.</li><li>Split ingredient (B) into 4 portions and sour cream into 3 portions. Pour in one portion of flour and sour cream alternately, beat well after each addition.</li><li>Take half of the mixture and gently mix with melted chocolate (do not over mix).</li><li>Scoop plain and chocolate batter alternately into pan, till all the batters are used up and gently shake the pan a little.</li><li>Bake for 50-60 minutes or skewer comes out clean.</li><li>Remove cake from oven and set to cool for 20 minutes then unmould, leave to cool completely.</li></ol>",
