    "summary": "The recipe Green Chili Cheddar Dip (Guest Post) could satisfy your American craving in roughly <b>45 minutes</b>. This recipe serves 2 and costs $2.06 per serving. One serving contains <b>634 calories</b>, <b>21g of protein</b>, and <b>58g of fat</b>. Plenty of people really liked this hor d'oeuvre. It can be enjoyed any time, but it is especially good for <b>The Super Bowl</b>. A mixture of cream cheese, garlic powder, chilis, and a handful of other ingredients are all it takes to make this recipe so yummy. It is a good option if you're following a <b>gluten free, primal, and vegetarian</b> diet. 122 people were impressed by this recipe. All things considered, we decided this recipe <b>deserves a spoonacular score of 60%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/guest-post-from-diethood-garlic-and-cheddar-drop-biscuits-515122\">Guest Post from Diethood – Garlic and Cheddar Drop Biscuits</a>, <a href=\"https://spoonacular.com/recipes/turkey-picadillo-quinoa-chili-guest-post-505017\">Turkey Picadillo Quinoa Chili {guest post}</a>, and <a href=\"https://spoonacular.com/recipes/guest-post-slow-cooker-veggie-chili-582423\">Guest Post: Slow Cooker Veggie Chili</a> for similar recipes.",
