    "instructions": "<ol><li>Preheat the oven to 180C/350F. Line a 30x40cm baking tray with paper. Combine the sugar, vanilla sugar and almond slices for the topping in a bowl. Set aside.</li><li>Sift the flour and baking powder into a mixing bowl. Add in Quark, milk, oil, sugar and salt. Mix all the ingredients with a hand mixer fitted with dough hooks for 1 minute on high speed. Dont over stir the dough or it will become sticky.</li><li>Place the dough onto the prepared tray and roll it out. Spread the softened butter all over the surface of the dough. Spead the topping mixture evenly onto the dough. Bake on the upper rack of the hot oven for about 20 minutes until golden crispy.</li></ol>",
