    "summary": "You can never have too many side dish recipes, so give Cheesy Cauliflower a try. One serving contains <b>223 calories</b>, <b>12g of protein</b>, and <b>14g of fat</b>. For <b>98 cents per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. A few people made this recipe, and 12 would say it hit the spot. A mixture of salt and pepper, butter, cayenne pepper, and a handful of other ingredients are all it takes to make this recipe so scrumptious. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 50%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/cheesy-cauliflower-431198\">Cheesy Cauliflower</a>, <a href=\"https://spoonacular.com/recipes/cheesy-cauliflower-609185\">Cheesy Cauliflower</a>, and <a href=\"https://spoonacular.com/recipes/cheesy-cauliflower-au-gratin-271965\">Cheesy Cauliflower au Gratin</a> for similar recipes.",
