    "sourceUrl": "http://www.foodista.com/recipe/7PSYMB8V/dairy-free-cocoa-cupcakes-with-peanut-butter-filling-marshmallow-frosting",
    "summary": "The recipe DAIRY-FREE COCOA CUPCAKES WITH PEANUT BUTTER FILLING, MARSHMALLOW FROSTING is ready <b>in about 45 minutes</b> and is definitely a spectacular <b>dairy free</b> option for lovers of American food. For <b>70 cents per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. This recipe makes 12 servings with <b>368 calories</b>, <b>7g of protein</b>, and <b>18g of fat</b> each. 8 people have tried and liked this recipe. A mixture of egg whites, freshly coffee, honey-roasted peanuts, and a handful of other ingredients are all it takes to make this recipe so tasty. All things considered, we decided this recipe <b>deserves a spoonacular score of 31%</b>. This score is rather bad. Similar recipes include <a href=\"https://spoonacular.com/recipes/peanut-butter-banana-cupcakes-with-chocolate-marshmallow-frosting-540566\">Peanut Butter Banana Cupcakes with Chocolate Marshmallow Frosting</a>, <a href=\"https://spoonacular.com/recipes/banana-chocolate-chip-cake-with-peanut-butter-frosting-gluten-free-dairy-free-soy-free-634040\">Banana Chocolate Chip Cake With Peanut Butter Frosting - gluten free, dairy free, soy free</a>, and <a href=\"https://spoonacular.com/recipes/peanut-butter-jelly-cupcakes-vanilla-cupcakes-with-jelly-filling-and-peanut-butter-frosting-523226\">Peanut Butter & Jelly Cupcakes [Vanilla Cupcakes with Jelly Filling and Peanut Butter Frosting]</a>.",
