    "summary": "Citrus Arugula Salad with Seared Scallops requires around <b>around 45 minutes</b> from start to finish. For <b>$1.45 per serving</b>, this recipe <b>covers 10%</b> of your daily requirements of vitamins and minerals. Watching your figure? This gluten free, dairy free, whole 30, and pescatarian recipe has <b>82 calories</b>, <b>9g of protein</b>, and <b>1g of fat</b> per serving. This recipe serves 2. A mixture of arugula, scallops, salt, and a handful of other ingredients are all it takes to make this recipe so flavorful. 7 people found this recipe to be scrumptious and satisfying. It works well as a side dish. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 59%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/seared-scallops-with-lemony-farro-and-arugula-salad-161631\">Seared Scallops with Lemony Farro and Arugula Salad</a>, <a href=\"https://spoonacular.com/recipes/seared-jumbo-sea-scallops-with-wilted-arugula-corn-shiitake-salad-soy-ginger-vinaigrette-257132\">Seared Jumbo Sea Scallops with Wilted Arugula, Corn, Shiitake Salad & Soy Ginger Vinaigrette</a>, and <a href=\"https://spoonacular.com/recipes/seared-scallops-with-citrus-ginger-sauce-197958\">Seared Scallops with Citrus Ginger Sauce</a> for similar recipes.",
