    "summary": "If you want to add more <b>lacto ovo vegetarian</b> recipes to your recipe box, Dessert That's No Problem: Baked Pears with Oatmeal Crumble might be a recipe you should try. One portion of this dish contains roughly <b>3g of protein</b>, <b>7g of fat</b>, and a total of <b>233 calories</b>. This recipe serves 4 and costs 53 cents per serving. It works well as a dessert. 13 people were glad they tried this recipe. It is brought to you by Foodista. A mixture of pears, oatmeal, cinnamon, and a handful of other ingredients are all it takes to make this recipe so delicious. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. Overall, this recipe earns a <b>not so tremendous spoonacular score of 21%</b>. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/plums-oatmeal-crumble-bars-eggless-dessert-s-606992\">Plums Oatmeal Crumble Bars | Eggless Dessert s</a>, <a href=\"https://spoonacular.com/recipes/baked-pears-dessert-511567\">Baked Pears Dessert</a>, and <a href=\"https://spoonacular.com/recipes/individual-oven-baked-banana-crumble-dessert-49788\">Individual Oven Baked Banana Crumble Dessert</a>.",
