    "summary": "Mediterrean Tuna Salad might be just the main course you are searching for. This recipe makes 2 servings with <b>422 calories</b>, <b>21g of protein</b>, and <b>34g of fat</b> each. For <b>$2.43 per serving</b>, this recipe <b>covers 22%</b> of your daily requirements of vitamins and minerals. It is a good option if you're following a <b>gluten free, dairy free, and pescatarian</b> diet. This recipe from Foodista has 6 fans. A mixture of wine vinegar, kalamatan olives, albacore solid tuna, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the balsamic vinegar you could follow this main course with the <a href=\"https://spoonacular.com/recipes/skinny-strawberry-ice-cream-667869\">Skinny Strawberry Ice Cream</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 71%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/sundays-healthy-yummy-real-tuna-salad-for-tuna-salad-melt-89711\">Sunday's Healthy, Yummy, Real Tuna Salad - for Tuna Salad, Melt</a>, <a href=\"https://spoonacular.com/recipes/health-benefits-of-tuna-mediterranean-tuna-antipasto-salad-482412\">Health Benefits of Tuna: Mediterranean Tunan Antipasto Salad</a>, and <a href=\"https://spoonacular.com/recipes/chili-crusted-ahi-tuna-avocado-salad-with-cilantro-garlic-dressing-gf-and-fave-five-friday-healthy-tuna-529639\">Chili Crusted Ahi Tuna & Avocado Salad with Cilantro Garlic Dressing (GF!) … and Fave Five Friday: Healthy Tuna</a> for similar recipes.",
