    "summary": "Beef Cottage Pie is a <b>gluten free</b> recipe with 8 servings. One portion of this dish contains around <b>16g of protein</b>, <b>6g of fat</b>, and a total of <b>181 calories</b>. For <b>$1.13 per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. 6 people were glad they tried this recipe. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. A mixture of ground beef, vegetables, thyme, and a handful of other ingredients are all it takes to make this recipe so delicious. It is brought to you by Foodista. With a spoonacular <b>score of 46%</b>, this dish is solid. <a href=\"https://spoonacular.com/recipes/roast-beef-cottage-pie-134924\">Roast Beef Cottage Pie</a>, <a href=\"https://spoonacular.com/recipes/chili-beef-cottage-pie-120456\">Chili Beef Cottage Pie</a>, and <a href=\"https://spoonacular.com/recipes/beef-bourguignon-cottage-pie-212786\">Beef bourguignon cottage pie</a> are very similar to this recipe.",
