    "imageType": "jpg",
    "summary": "Banana- Honey Chocolate Chip Bread might be just the bread you are searching for. This recipe serves 1 and costs $14.92 per serving. One serving contains <b>6995 calories</b>, <b>114g of protein</b>, and <b>256g of fat</b>. This recipe is liked by 6 foodies and cooks. If you have flour, baking soda, sugar, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 88%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/honey-whole-wheat-chocolate-chip-banana-bread-523959\">Honey Whole Wheat Chocolate Chip Banana Bread</a>, <a href=\"https://spoonacular.com/recipes/chocolate-chip-banana-bread-plus-sweet-banana-roundup-532666\">Chocolate Chip Banana Bread Plus Sweet Banana Roundup</a>, and <a href=\"https://spoonacular.com/recipes/honey-sweetened-low-fat-banana-chocolate-chip-muffins-517251\">Honey- Sweetened Low Fat Banana Chocolate Chip Muffins</a> for similar recipes.",
