    "summary": "Linguine with Prawns, Fresh Tomatoes and Spinach might be just the main course you are searching for. This recipe serves 4 and costs $3.93 per serving. Watching your figure? This pescatarian recipe has <b>742 calories</b>, <b>41g of protein</b>, and <b>23g of fat</b> per serving. Head to the store and pick up butter, fettuccine barilla, salt and pepper, and a few other things to make it today. To use up the olive oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/sauteed-banana-granola-and-yogurt-parfait-624619\">Sauteed Banana, Granolan and Yogurt Parfait</a> as a dessert. A couple people made this recipe, and 10 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 86%</b>. This score is super. Try <a href=\"https://spoonacular.com/recipes/linguine-with-fresh-tomatoes-443547\">Linguine with Fresh Tomatoes</a>, <a href=\"https://spoonacular.com/recipes/linguinie-with-prawns-spinach-tomatoes-and-goat-cheese-567454\">Linguinie with Prawns, Spinach, Tomatoes and Goat Cheese</a>, and <a href=\"https://spoonacular.com/recipes/linguine-with-fresh-tuna-tomatoes-and-lemon-7856\">Linguine with Fresh Tuna, Tomatoes and Lemon</a> for similar recipes.",
