    "summary": "Lime S’more Tartlets might be just the hor d'oeuvre you are searching for. For <b>$25.07 per serving</b>, this recipe <b>covers 81%</b> of your daily requirements of vitamins and minerals. One serving contains <b>8650 calories</b>, <b>173g of protein</b>, and <b>308g of fat</b>. 38 people have made this recipe and would make it again. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. If you have granulated sugar, spring form tart pans, lime juice, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 92%</b>. This score is super. Try <a href=\"https://spoonacular.com/recipes/key-lime-tartlets-134297\">Key Lime Tartlets</a>, <a href=\"https://spoonacular.com/recipes/key-lime-tartlets-602545\">Key Lime Tartlets</a>, and <a href=\"https://spoonacular.com/recipes/lime-tartlets-424598\">Lime Tartlets</a> for similar recipes.",
