    "imageType": "jpg",
    "summary": "The recipe Mini Stuffed Mexican Bell Peppers could satisfy your Mexican craving in around <b>45 minutes</b>. Watching your figure? This gluten free and dairy free recipe has <b>367 calories</b>, <b>28g of protein</b>, and <b>5g of fat</b> per serving. For <b>$5.22 per serving</b>, you get a side dish that serves 4. Not a lot of people made this recipe, and 7 would say it hit the spot. Head to the store and pick up onion, chipotles in adobo, chili powder, and a few other things to make it today. All things considered, we decided this recipe <b>deserves a spoonacular score of 94%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/mexican-stuffed-bell-peppers-723624\">Mexican Stuffed Bell Peppers</a>, <a href=\"https://spoonacular.com/recipes/jerk-chicken-and-stuffed-mini-bell-peppers-217041\">Jerk Chicken and Stuffed Mini Bell Peppers</a>, and <a href=\"https://spoonacular.com/recipes/goat-cheese-stuffed-mini-bell-peppers-619765\">Goat Cheese Stuffed Mini Bell Peppers</a> for similar recipes.",
