    "occasions": [ ],
    "instructions": "<ol><li>1. Roast the vegetables:  Preheat oven to 400 degrees.Cut the tomatillos in half, slice the onion into 1/2 in slices and remove garlic from covering. Place on baking sheet. Roast till tomatillos are tender and start to brown, about 20 minutes.</li><li>2. Meanwhile,make the sauce: Add tomatillos, onion, garlic, tomatoes, green chilies, chipotles, chili powder, cumin, paprika, and coriander to blender or food processor. Blend until smooth.</li><li>3. In a large bowel, add the turkey, beans, and sauce, Mix together until everything is evenly distributed.</li><li>4. Cut tops off mini bell peppers and remove any seeds. Stuff turkey mixture into peppers until slightly overflowing. Place in 9 by 13 glass dish. Repeat for all bell peppers.</li><li>5. Cook at 400 for 20 minutes. For the last 5 minutes, turn on the broiler and get some color on the peppers.</li><li>6. Serve with your favorite salsa (used my Pico De Gallo from my tortilla soup), sour cream and avocado.</li><li>ENJOY!</li></ol>",
