    "summary": "15 Minute Healthy Dark Chocolate Truffles might be a good recipe to expand your side dish recipe box. This recipe makes 12 servings with <b>108 calories</b>, <b>2g of protein</b>, and <b>7g of fat</b> each. For <b>42 cents per serving</b>, this recipe <b>covers 4%</b> of your daily requirements of vitamins and minerals. 39 people found this recipe to be flavorful and satisfying. A mixture of dates, sea salt, water, and a handful of other ingredients are all it takes to make this recipe so scrumptious. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. It is a good option if you're following a <b>gluten free, dairy free, lacto ovo vegetarian, and vegan</b> diet. It is brought to you by Foodista. With a spoonacular <b>score of 42%</b>, this dish is solid. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/dark-chocolate-truffles-473154\">Dark Chocolate Truffles</a>, <a href=\"https://spoonacular.com/recipes/dark-chocolate-truffles-520794\">Dark chocolate truffles</a>, and <a href=\"https://spoonacular.com/recipes/dark-chocolate-blueberry-truffles-609115\">Dark Chocolate Blueberry Truffles</a>.",
