    "summary": "Need a <b>dairy free and pescatarian hor d'oeuvre</b>? Crawfish Cake Sliders could be an excellent recipe to try. One portion of this dish contains around <b>9g of protein</b>, <b>6g of fat</b>, and a total of <b>181 calories</b>. For <b>60 cents per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. This recipe serves 8. 15 people were impressed by this recipe. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. It is brought to you by Foodista. If you have egg, tartar sauce, onion, and a few other ingredients on hand, you can make it. With a spoonacular <b>score of 25%</b>, this dish is rather bad. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/cajun-crawfish-sliders-404940\">Cajun Crawfish Sliders</a>, <a href=\"https://spoonacular.com/recipes/crawfish-jalapeno-cheese-cornbread-topped-with-crawfish-etouffee-362029\">Crawfish Jalapeno Cheese Cornbread topped with Crawfish Etouffee</a>, and <a href=\"https://spoonacular.com/recipes/crab-cake-sliders-303927\">Crab Cake Sliders</a>.",
