    "summary": "Asian Chickpea Lettuce Wraps takes approximately <b>around 45 minutes</b> from beginning to end. Watching your figure? This gluten free, dairy free, lacto ovo vegetarian, and vegan recipe has <b>58 calories</b>, <b>1g of protein</b>, and <b>3g of fat</b> per serving. For <b>32 cents per serving</b>, you get a hor d'oeuvre that serves 6. 15 people were glad they tried this recipe. If you have sugar, chili sauce, hoison sauce, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. It is an <b>inexpensive</b> recipe for fans of Asian food. Overall, this recipe earns a <b>solid spoonacular score of 65%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/chickpea-curry-lettuce-wraps-604089\">Chickpea Curry Lettuce Wraps</a>, <a href=\"https://spoonacular.com/recipes/salsa-chickpea-lettuce-wraps-263218\">Salsa Chickpea Lettuce Wraps</a>, and <a href=\"https://spoonacular.com/recipes/curry-and-chickpea-lettuce-wraps-760193\">Curry and Chickpea Lettuce Wraps</a>.",
