    "summary": "Pecan Sandies might be just the main course you are searching for. This recipe makes 1 servings with <b>4578 calories</b>, <b>41g of protein</b>, and <b>288g of fat</b> each. For <b>$7.55 per serving</b>, this recipe <b>covers 56%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. Only a few people made this recipe, and 8 would say it hit the spot. A mixture of butter, vanilla, flour, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the butter you could follow this main course with the <a href=\"https://spoonacular.com/recipes/cinnamon-butter-cake-60334\">Cinnamon Butter Cake</a> as a dessert. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 86%</b>. This score is excellent. Try <a href=\"https://spoonacular.com/recipes/pecan-sandies-140685\">Pecan Sandies</a>, <a href=\"https://spoonacular.com/recipes/pecan-sandies-312550\">Pecan Sandies</a>, and <a href=\"https://spoonacular.com/recipes/pecan-sandies-624096\">Pecan Sandies</a> for similar recipes.",
