    "instructions": "<ol><li>In a large bowl, whisk flour, salt, and baking soda. Set aside. </li><li>In a separate large bowl, beat butter with sugars and oil until well combined. Beat in eggs and vanilla. Gradually add in flour mixture, beating just until combined. Stir in the chopped pecans. Cover and chill the dough for at least 30 minutes. </li><li>When ready to bake, preheat the oven to 375 degrees F. Drop by tablespoon-fuls onto a cookie sheet and bake for about 10 minutes, until light brown in color.</li></ol>",
