    "summary": "Creamy Vegan Butternut Squash Mac and Cheese might be just the side dish you are searching for. One serving contains <b>312 calories</b>, <b>11g of protein</b>, and <b>8g of fat</b>. This dairy free recipe serves 6 and costs <b>88 cents per serving</b>. 40 people have made this recipe and would make it again. From preparation to the plate, this recipe takes around <b>45 minutes</b>. If you have water, nutritional yeast, vegan buttery spread, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 66%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/vegan-mac-n-peas-with-creamy-butternut-squash-sauce-690179\">Vegan Mac ‘n Peas with Creamy Butternut Squash Sauce</a>, <a href=\"https://spoonacular.com/recipes/creamy-butternut-squash-soup-vegan-winner-of-go-veggie-511040\">Creamy Butternut Squash Soup (Vegan) / Winner of GO Veggie</a>, and <a href=\"https://spoonacular.com/recipes/creamy-vegan-butternut-squash-linguine-with-peas-and-kale-610789\">Creamy Vegan Butternut Squash Linguine with Peas and Kale</a> for similar recipes.",
