    "instructions": "<ol><li> Begin by Preheating oven to 350</li><li>Bring a large pot of salted water to a boil over medium heat, add in elbows and cook until pasta is al dente.</li><li>While waiting for pasta to cook begin preparing your sauce. In a medium size sauce pan, melt butter over medium heat, add in nutritional yeast and mix together to form a paste</li><li>Add in soy milk, using a whisk combine together ingredients make sure your sauce is lump free, let simmer for 5 minute or until sauce begins to thicken</li><li>Add is pureed butternut squash, thoroughly mix together ingredients to ensure everything is well blended (you may notice that the butternut squash also helps to thicken the sauce).</li><li>Stir in Cheese, let sit for 1 to 2 minutes or until sauce has a creamy velvety smooth consistency. Remove Sauce from heat and let sit</li><li>Drain pasta and add pasta to the cheese sauce, stir together and pour mixture into a greased 9 x 9 baking pan</li><li>Sprinkle breadcrumbs over macaroni and cheese and let bake for 15 minutes or until cheese begins to bubble</li><li>Serve Warm and enjoy this creamy Vegan home-style comfort food!</li></ol>",
