    "summary": "Yoghurt Chicken and Garlic Potatoes might be just the main course you are searching for. For <b>$3.25 per serving</b>, this recipe <b>covers 47%</b> of your daily requirements of vitamins and minerals. This recipe makes 1 servings with <b>586 calories</b>, <b>61g of protein</b>, and <b>12g of fat</b> each. A few people made this recipe, and 85 would say it hit the spot. If you have water, seasoning cubes, yoghurt, and a few other ingredients on hand, you can make it. To use up the ice cubes you could follow this main course with the <a href=\"https://spoonacular.com/recipes/nectarine-blackberry-and-pecan-sundaes-50465\">Nectarine, Blackberry, and Pecan Sundaes</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. It is a good option if you're following a <b>gluten free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 99%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/grilled-chicken-guacamole-taco-with-garlic-yoghurt-tahini-sauce-623194\">Grilled Chicken & Guacamole Taco with Garlic-Yoghurt-Tahini Sauce</a>, <a href=\"https://spoonacular.com/recipes/beef-mince-and-macaroni-with-a-yoghurt-garlic-sauce-144499\">Beef Mince and Macaroni with a Yoghurt-Garlic-Sauce</a>, and <a href=\"https://spoonacular.com/recipes/chicken-with-yoghurt-124458\">Chicken with Yoghurt</a> for similar recipes.",
