    "step": "Heat your oven to 400 degrees. Use a spoon (or a piping bag) to stuff the peppers liberally and place them back on the baking sheet.  There is enough stuffing here to really pack those suckers up, so you dont need to worry about the amount of cream cheese youre portioning out.  If the cream cheese is very soft, place the baking sheet in the refrigerator for 15 minutes to allow it to set up. If not, place pop the peppers in the oven and bake about 8 minutes.  Change oven setting to high broil and bake an additional 2 minutes, until the tops of the cream cheese begin to brown (If theyre already brown at this point, skip the broiling).Put on a pretty plate and serve to your friends.",
