    "summary": "Chocolate-Date Cake with Chocolate Sticky Toffee Glaze requires approximately <b>about 45 minutes</b> from start to finish. One portion of this dish contains approximately <b>3g of protein</b>, <b>14g of fat</b>, and a total of <b>283 calories</b>. For <b>94 cents per serving</b>, you get a dessert that serves 21. It is brought to you by Foodista. Head to the store and pick up eggs, flour, , and a few other things to make it today. This recipe is liked by 15 foodies and cooks. Taking all factors into account, this recipe <b>earns a spoonacular score of 16%</b>, which is not so great. Try <a href=\"https://spoonacular.com/recipes/chocolate-date-cake-with-chocolate-sticky-toffee-glaze-56667\">Chocolate-date Cake With Chocolate Sticky Toffee Glaze</a>, <a href=\"https://spoonacular.com/recipes/sticky-toffee-date-cake-with-brown-sugar-caramel-sauce-481995\">Sticky Toffee Date Cake with Brown Sugar Caramel Sauce</a>, and <a href=\"https://spoonacular.com/recipes/sticky-toffee-chocolate-fig-pudding-cake-496904\">Sticky Toffee & Chocolate Fig Pudding Cake</a> for similar recipes.",
