    "summary": "Bleu Cheese Stuffed Wine Cherries With Honeycomb is a <b>gluten free and vegetarian</b> beverage. For <b>94 cents per serving</b>, this recipe <b>covers 2%</b> of your daily requirements of vitamins and minerals. This recipe makes 8 servings with <b>88 calories</b>, <b>1g of protein</b>, and <b>1g of fat</b> each. 14 people have made this recipe and would make it again. A mixture of cinnamon stick, lemon zest, cherries, and a handful of other ingredients are all it takes to make this recipe so delicious. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 13%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/stuffed-bleu-cheese-potatoes-43871\">Stuffed Bleu Cheese Potatoes</a>, <a href=\"https://spoonacular.com/recipes/bleu-cheese-stuffed-figs-57022\">Bleu Cheese Stuffed Figs</a>, and <a href=\"https://spoonacular.com/recipes/chicken-breasts-stuffed-with-prosciutto-and-gruyre-cheese-chicken-cordon-bleu-163336\">Chicken Breasts Stuffed with Prosciutto and Gruyère Cheese (Chicken Cordon Bleu)</a> for similar recipes.",
