    "instructions": "<ol><li>Preheat oven to 160C/320F. Line a rectangle cake pan.</li><li>Combine butter and chopped baking chocolate over low heat until melted. Remove from heat and set aside to cool.</li><li>Place eggs. brown sugar, and vanilla extract in a mixing bowl and beat till fluffy and add in the melted butter chocolate mixture, stir till well combined.</li><li>Add self rising flour, cinnamon, walnuts, and green apple, mix well and pour into prepared cake pan.</li><li>Bake in preheated oven for 40 to 45 minutes and leave cake to cool. Best to chill for at least one hour for easy spreading of the ganache cream.</li><li>To make the chocolate ganache: bring the cream to just a boil over medium-high heat.</li><li>Add in the semi-sweet chocolate pieces and blend well till chocolate melts. </li><li>Whisk until creamy.</li><li>Let cool and spread onto cake.</li></ol>",
