    "summary": "The recipe Apple Pie could satisfy your American craving in around <b>45 minutes</b>. One serving contains <b>567 calories</b>, <b>7g of protein</b>, and <b>12g of fat</b>. For <b>$1.96 per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. A mixture of butter, cinnamon, lemon juice, and a handful of other ingredients are all it takes to make this recipe so tasty. This recipe is liked by 23 foodies and cooks. A few people really liked this dessert. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 45%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/apple-pie-cinnamon-rolls-921030\">Apple Pie Cinnamon Rolls</a>, <a href=\"https://spoonacular.com/recipes/apple-butter-pie-bars-927912\">Apple Butter Pie Bars</a>, and <a href=\"https://spoonacular.com/recipes/apple-pie-baked-doughnuts-922655\">Apple Pie Baked Doughnuts</a> for similar recipes.",
